import React from "react";
import './css/Home_body.css';
import me from '../assets/images/me.png'

function Home_body() {
    return(
        <>
            <div className="body">
                <div className="col-1">
                    <div className="item1"></div>
                    <div className="item2">
                        <h1>
                            
                        </h1>
                    </div>
                    <div className="item3"></div>
                    <div className="item4"></div>
                </div>
                <div className="col-2">
                    <img src={me}/>
                </div>
            </div>
        </>
    );
}
export default Home_body;
